import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";

const Menu = () => {
  return (
    <Container>
      <Row>
        <Col className="d-flex justify-content-center">
          <h1>OPCIONES</h1>
        </Col>
      </Row>
      <Row>
        <Col className="d-flex justify-content-center">
          <Card className="mx-5">
            <Card.Body></Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Menu;
